eligibilityCriteria:
Inclusion Criteria:

* Diagnosis of esophageal malignancy cancer;
* Ability to understand and collaborate during treatment;

Exclusion Criteria:

* Previous gastrectomy;
* Previous abdominal surgery with risk of altering stomach vascularization;
* Previous head and neck surgery with risk of alteration of cervical vessels.

Inclusion Criteria:

* Confirmed histological diagnosis of squamous cell carcinoma or undifferentiated carcinoma of the oropharynx, hypopharynx or larynx;
* Locally advanced stage (stage IVa / b - AJCC 8th edition), classified as resectable \*\* or unresectable and candidate for treatment based on radiotherapy and chemotherapy;
* Locally advanced stage (stage III - AJCC 8th edition), classified as resectable or unresectable, positive p16 and candidate for treatment based on radiotherapy and chemotherapy;
* It will be allowed to include a patient with cervical lymphadenectomy if the primary lesion is measurable;
* Presence of measurable disease according to RECIST 1.1 criteria;
* ECOG of 0-1;
* ≥ 18 years;
* Adequate marrow reserve indicated by:

  * Absolute neutrophil count (ANC) ≥ 1500 / mm³ or Platelets\> 100,000 / mm³
  * Hemoglobin ≥ 9 g / dL - red blood cell transfusion will be allowed in the screening period if necessary
* Adequate renal and hepatic function:

  * Serum bilirubin ≤ 1.5 times the upper limit of normal the TGO and TGP ≤ 3 upper limit of normal. If hepatic metastasis ≤ 5 upper limit of normal
  * Serum creatinine ≤ 1.5 mg / dL and creatinine clearance ≥ 60 mL / min calculated by Cockcroft-Gault.

Exclusion Criteria:

* Patient submitted to curative resection of the primary site and / or metastatic site. NOTE: Patients submitted to cervical lymphadenectomy without surgery to the primary tumor are eligible;
* Radiation therapy or previous chemotherapy for head / neck tumor;
* Patients with occult primary tumor;
* T4 from any site, resectable, with invasion of cartilage or jaw;
* History of BMT or stem cell therapy;
* Synchronous tumor or previous history of neoplasia, except for in situ carcinoma of the cervix, basal cell carcinoma or epidermoid carcinoma. Patients with previous history of cancer already treated and without evidence of disease for more than 3 years may participate in the study;
* Prophylactic use of G-CSF or GM-CSF two weeks prior to the study;
* Clinically significant heart disease: unstable angina or myocardial infarction 6 months prior to study entry Symptomatic ventricular arrhythmia the ICC classified as NYHA ≥ II • Uncontrolled hypercalcemia;
* Uncontrolled infection;
* Any other comorbidity that the investigator's judgment is inappropriate for the study;
* Peripheral neuropathy\> grade 2;
* Hearing loss\> grade 2;
* Known positive serology for hepatitis B, hepatitis C or HIV
* Use of antiretrovirals;

Inclusion Criteria:

* Female participants, with at least 18 years old on the day of signing the free and informed consent;
* Invasive breast carcinoma stage III (RH positive) or IIB/III (RH negative), according to TNM 8th edition; Histologically confirmed diagnosis of invasive breast carcinoma (with any histology), HER2 negative;
* The participant (or legally acceptable representative, if applicable) provides written informed consent for the study;
* The participant must agree to use a contraceptive as detailed in Appendix B of this protocol during the treatment period and for at least 120 days after the last dose of the study treatment;
* Have a functional capacity according to the ECOG from 0 to 2. The evaluation of the ECOG must be carried out within 7 days before the inclusion date.
* Have adequate organic function. The samples must be collected within 60 days before the start of the study treatment;
* Have adequate cardiac function as assessed by echocardiogram or MUGA performed up to 60 days before the start of treatment under study.

Exclusion Criteria:

- Individuals who do not meet the inclusion criteria above-mentioned.

Inclusion Criteria:

* Biopsy of plasma cell neoplasm with bone lesion treatable with radiotherapy;
* Age between 18 and 85 years old;
* Performance on the ECOG <= 2.
* Not using systemic therapies for 4 weeks OR being on maintenance therapy with the same drug for at least 4 weeks before radiotherapy.

Exclusion Criteria:

* Refusing to sign or inability to understand the consent term;
* Pain less than 2/10 on the numeric pain rating scale;
* Change in systemic treatment scheme, including use of bone metabolism modulation drugs, up to 4 weeks before radiotherapy treatment;
* Technical incapacity for the treatment, including, but not limited to, weight > 115Kg, inability to abduct the limb to be treated in appendicular bones, intolerable pain to remain in the treatment position;
* Previous cancer and previous oncological treatments;
* Previous autoimmune diseases, even if controlled;
* Current pregnancy.

Inclusion Criteria:

* Patients with advanced malignant neoplasm of the esophagus, whether or not undergoing chemotherapy or radiotherapy;
* Dysphagia score > 2 or presence of malignant esophagorespiratory fistula;
* Indication of palliation of dysphagia through the placement of esophageal prostheses in a multidisciplinary meeting.

Exclusion Criteria:

* Patients under 18 years;
* Extraesophageal neoplasms;
* Lesions with longitudinal extension less than 30 mm;
* Previous treatment with esophageal prosthesis;
* Tumors easily transposed to standard endoscope (9.8mm).

Inclusion Criteria:

* eighteen years old minimum;
* be living in Porto Alegre or metropolitan region;
* breast cancer stage 0 - III OR
* localized prostate cancer;
* undergoing hormonal treatment / manipulation in isolation or combined with other therapies three months prior to the entrance in the study;
* hormonal therapy / manipulation planned to be active throughout the study duration;
* not engaged in any exercise training for more than once a week for the past 6 months;
* in case of previous surgical procedure, the patient must have medical clearance at the moment of the contact to begin the study or be cleared to do so in the near future (up to two weeks).

Exclusion Criteria:

* metastatic phase / progression of the disease or active regional location prior to beginning of the study;
* inability to understand the terms and conditions of study due to language, hearing, cognitive or severe psychiatric issues;
* another family member, who lives at the same residence, participating in the study;
* planning to move or major absence (more than two weeks) during the study;
* history of cardiovascular disease (except controlled hypertension) or severe cardiopulmonary disease, as well as history of heart attack, revascularization procedures, profound venous thrombosis, encephalic vascular accident (brain stroke) or pulmonary embolism in the past twelve months;
* chronic pulmonary disease that requires oxygen or corticosteroid therapy;
* kidney disease with or that is going to begin the use of dialysis or waiting for a kidney transplant;
* severe nausea, anorexia or any other condition which does not allow to perform physical exercise;
* medical contraindication to exercise training.

Inclusion Criteria:

* Information to the patient and signed informed consent;
* Women aged ≥18 years;
* Breast conserving surgery;
* Invasive adenocarcinoma (except classic invasive lobular carcinoma);
* TNM (Tumor, Nodes, Metastasis) pathologic stage pT1-3 and pN1-3a M0, with indication of lymphatic drainage according to institutional protocol;
* ECOG 0 -1;
* Minimum microscopic margin of non-cancerous tissue of 2 mm (excluding deep margin if in the deep fascia);
* No previous breast or mediastinal radiotherapy;
* No hematogenous metastases;
* Ability to carry out long-term follow-up;

Exclusion Criteria:

* Previous local irradiation;
* Concomitant chemotherapy. Concomitance with trastuzumab or hormone blockade will be allowed;
* Histology of metaplastic carcinoma;
* History of another neoplasm: non-melanoma skin cancer, carcinoma in situ of the uterine cervix. Another neoplasm treated with curative intent and without evidence of disease in the last 5 years will be allowed.
* Diagnosis of autoimmune and connective tissue diseases;
* Diagnosis of genetic alterations in cell repair genes (Ex: Fanconi anemia, ataxia teleangiectasia);
* Indication of internal breast irradiation.

Inclusion Criteria:

* Diagnosis of malignant neoplasia (hematological or solid tumors);
* Responsible and participants agree to the study participation after reading and signing the Informed Consent Form (ICF) and Informed Term of Consent (TALE) for participation in Clinical Research;
* They performed the chemotherapy infusions hospitalized in the pediatric oncology department of the 3rd east of HCPA;
* Received the following chemotherapy protocols: MTX-HD, combination chemotherapy of MTX-HD, doxorubicin and cyclophosphamide; and MTX-HD and cyclophosphamide.

Exclusion Criteria:

* Participants will be excluded who:
* Patients over the age of 18 years
* Patients who will undergo HSCT

Inclusion Criteria:

* Women with confirmed histological diagnosis of invasive ductal carcinoma and lobular breast carcinoma;
* Radical mastectomy with immediate reconstruction with a prosthesis;
* Patients indicated for adjuvant RT;
* Any lymph node status;
* With or without adjuvant chemotherapy;
* ECOG from 0-2;
* \> 18 years old;
* Informed Consent Form applied before any study-specific procedure.

Exclusion Criteria:

* Another histological diagnosis than invasive ductal carcinoma or lobular carcinoma;
* Previous history of neoplasm and/or radiotherapy and/ or quimiotherapy before this study;
* Distant metastatic disease;
* Palliative treatment;
* Patients with scleroderma / systemic lupus erythematosus.

Inclusion Criteria:

For non-Hodgkin Lymphomas (B-NHL):

* Provision of signed Informed Consent form;
* Age between 18 and 70 years;
* Performance status according to the ECOG \< 2;
* Relapsed or refractory B-NHL of the following types (confirmed by biopsy):

  * Diffuse large B-cell lymphoma (DLBCL, NOS);
  * High-grade B-cell lymphoma (HGBCL);
  * Diffuse large B-cell lymphoma/high-grade B-cell lymphoma with MYC and BCL-2 rearrangement;
  * Follicular lymphoma (FL) grade 3B; or
  * Transformed follicular lymphoma (tFL)
* Refractory or relapsed to two or more lines of systemic therapy, with at least one scheme containing an anti-CD20 monoclonal antibody and anthracycline, as defined below:

  * Refractoriness: partial response (PR), stable disease (SD), or progressive disease (PD) as the best response to the last treatment, assessed by PET-CT, according to the Lugano criteria and confirmed by a new biopsy.
  * Relapsed disease: disease reappearance after obtaining a complete response to the last treatment, assessed by PET-CT, according to the Lugano criteria and confirmed by a new biopsy.
* Have performed, or be ineligible for, autologous hematopoietic progenitor cell transplantation (ASCT). Ineligibility is defined by:

  * Lack of at least partial response after salvage chemotherapy; or
  * Failure to mobilize and/or collect hematopoietic progenitor cells (HPC), as defined by the investigator.
* Measurable disease, defined as:

  * Nodal lesions \>15 mm in the long axis, regardless of the length of the short axis, and/or
  * Extranodal lesions (outside lymph node or nodal mass, but including liver and spleen) \>10 mm in long axis, regardless of the length of the short axis.
* Adequate organ function:

Renal function defined as:

* estimated glomerular filtration rate (eGFR) ≥ 40 mL/min/1.73 m2

Hepatic function defined as:

* Alanine Transaminase (ALT) and Aspartate Transaminase (AST) ≤ 2.5 × ULN; and
* Total bilirubin ≤ 1.5 × ULN, except for patients with Gilbert syndrome.

Hematologic Function (regardless of transfusions for 14 days) defined as:

* Absolute neutrophil count (ANC) \>500/uL
* Platelets ≥ 50,000/uL
* Hemoglobin \>7.0 g/dl

  * In women of childbearing potential, willingness to use effective means of birth control for 1 year after CAR-T cell infusion.
  * In male participants, willingness to use a barrier birth control method for 1 year after CAR-T cell infusion
  * Able to comply with inpatient treatment, outpatient treatment, laboratory monitoring, and required clinic visits for the duration of study participation.

For Acute Lymphoblastic Leukemia (B-ALL):

* Provision of signed Informed Consent form;
* Age ≥ 3 and \< 25 years;
* Performance status \< 2, according to the ECOG for patients ≥ 16 years old, or ≥ 50%, according to the Lansky scoress for patients younger than 16 years old;
* Relapsed or refractory CD19 positive B-ALL, with documentation of CD19 disease expression within 3 months of screening visit.
* Relapsed or refractory disease as defined below;

  * Failure to obtain hematologic complete remission (bone marrow with \< 5% lymphoblasts by morphologic assessment) after 2 distinct chemotherapy lines; or
  * Relapsed or refractoriness after at least 1 previous chemotherapy regimen and ineligibility for allogeneic hematopoietic progenitor cell transplantation (HSCT) due to lack of available donor (including alternative donors), comorbidity, have previously undergone or refused HSCT; or
  * Relapsed disease ≥ 6 months after HSCT; or
  * Relapsed or refractoriness after ≥ TKi for Philadelphia-positive B-ALL.
* Bone marrow with ≥ 5% lymphoblasts by morphologic assessment within 30 days from screening
* Adequate organ function:

Renal function defined as:

* Estimated glomerular filtration rate (eGFR) ≥ 40 mL/min/1.73 m2

Hepatic function defined as:

* Alanine Transaminase (ALT) and Aspartate Transaminase (AST) ≤ 5 × ULN; and
* Total bilirubin ≤ 2 × ULN, except for patients with Gilbert syndrome.

  * In women of childbearing potential, willingness to use effective means of birth control for 1 year after CAR-T cell infusion.
  * In male participants, willingness to use a barrier birth control method for 1 year after CAR-T cell infusion
  * Able to comply with outpatient treatment, laboratory monitoring, and required clinic visits for the duration of study participation. duration of the parent study and the long-term follow-up observational study

Exclusion Criteria:

For non-Hodgkin Lymphomas (B-NHL):

* Previous or concurrent cancer distinct from B-NHL within 2 years before screening, except for the following:

  * Curatively treated nonmelanomatous skin cancer;
  * Curatively treated cervical carcinoma in situ;
  * Localized breast cancer treated with curative intent with no evidence of active disease; or
  * Localized prostate cancer undergoing active surveillance or anti-androgenic therapy, without evidence of metastatic disease.
* Syndromes and/or genetic diseases with impact on the hematopoietic system, including Down's syndrome, Fanconi anemia, telomeropathies, Li Fraumeni, Blackfan-Diamond anemia, or congenital immunodeficiencies;
* History of previous CAR-T therapy;
* History of previous solid organ transplantation;
* Active central nervous system (CNS) involvement by disease, detected by image or cytology/immunophenotyping of cerebrospinal fluid (CSF);
* Primary central nervous system lymphoma (PCNSL);
* Primary mediastinal large B cell lymphoma (PMBCL);
* Evidence of uncontrolled systemic infection (viral, bacterial, or fungal) which requires IV antibiotics, within 2 weeks before the screening visit;
* Known HIV infection;
* Known HTLV I and II infection;
* History of previous tuberculosis;
* Positive Chagas disease serology;
* Hepatitis B or hepatitis C testing indicating active/ongoing infection, as defined as:

  * HBV: Patients with positive HBsAg are excluded. Patients with positive anti-HBc and negative HBsAg require hepatitis B PCR evaluation before randomization. Patients who are hepatitis B PCR-positive will be excluded.
  * HCV: Patients with positive hepatitis C antibody may be enrolled with a negative result for hepatitis C RNA before study inclusion. Patients who are hepatitis C RNA-positive will be excluded.
* History of a symptomatic CNS disease (or which required treatment within the past year), such as stroke, epilepsy, CNS vasculitis, or neurodegenerative disease;
* Significant cardiovascular disease defined as ≥ grade 3 New York Heart Association functional classification system of heart failure, history of myocardial infarction, uncontrolled or symptomatic arrhythmias, or unstable angina within the past 6 months before the screening;
* Chronic lung disease, with hypoxemia (Oxygen saturation measured by pulse oximetry \> 93% on room air), or uncontrolled within 4 weeks before the screening visit
* History of an autoimmune disease (including, but not limited to, myasthenia gravis, myositis, autoimmune hepatitis, systemic lupus erythematosus, rheumatoid arthritis, inflammatory bowel disease, vascular thrombosis associated with antiphospholipid syndrome, Wegener's granulomatosis, Sjögren's syndrome, Guillain-Barré syndrome, multiple sclerosis, vasculitis, or glomerulonephritis) with end-organ damage or requiring systemic immunosuppression/systemic disease-modifying agents in the 2 years preceding the screening visit;

  * Participants with hypothyroidism receiving a stable dose of thyroid replacement hormone may be eligible.
  * Participants with controlled type 1 diabetes mellitus who are on an insulin regimen are eligible for the study.
* History of deep vein thrombosis or pulmonary embolism within 6 months before the screening visit, or need to use systemic anticoagulation at the time of screening for any other reason;
* Major surgery within 4 weeks of the screening visit;
* History or suspicion of hemophagocytic lymphohistiocytosis (HLH);
* Vaccination with a live or attenuated virus vaccine within one month before the screening visit;
* Patients with known hypersensitivity, including anaphylaxis, to any component of the investigational treatment;
* Pregnancy, lactation, or plan to get pregnant during the study or within 12 months after CAR-T cell infusion;
* In women of childbearing potential a negative serologic pregnancy test must be obtained 7 days before CAR-T cell infusion;
* Women of childbearing potential, and all male participants, must be willing to observe barrier and highly effective birth control methods (outlined in the study protocol) for 12 months following CAR-T cell infusion;
* Presence of any other medical condition that in the investigator's opinion may interfere with the safety or effectiveness evaluation of the study;
* Life expectancy less than 12 weeks, by investigator assessment.

For Acute Lymphoblastic Leukemia (B-ALL)::

* Previous or concurrent cancer distinct from B-NHL within 2 years before screening, except for the following:

  * Curatively treated nonmelanomatous skin cancer;
  * Curatively treated cervical carcinoma in situ;
  * Localized breast cancer treated with curative intent with no evidence of active disease; or
  * Localized prostate cancer undergoing active surveillance or anti-androgenic therapy, without evidence of metastatic disease.
* Syndromes and/or genetic diseases with impact on the hematopoietic system, including Down's syndrome, Fanconi anemia, telomeropathies, Li Fraumeni, Blackfan-Diamond anemia, or congenital immunodeficiencies;
* Isolated extramedullary disease;
* Active central nervous system (CNS) involvement by disease (CNS-3 according to NCCN guideline), detected by cytology/immunophenotyping of cerebrospinal fluid (CSF) within 30 days from screening visit.

  * Patients with CNS-1 and CNS-2 within 30 days from screening visit may be enrolled;
* Burkitt's Leukemia/Lymphoma
* Active acute or chronic graft-versus-host disease (GvHD), or controlled with immunosuppressants in the previous 12 weeks before the screening visit;
* Failure to obtain hematologic complete remission (bone marrow with \< 5% lymphoblasts by morphologic assessment) after an anti-CD19 antibody-containing treatment (e.g. Blinatumomab);
* History of previous CAR-T therapy;
* History of previous solid organ transplantation;
* Evidence of uncontrolled systemic infection (viral, bacterial, or fungal) which requires IV antibiotics, within 2 weeks before the screening visit;
* Known HIV infection;
* Known HTLV I and II infection;
* History of previous tuberculosis;
* Positive Chagas' disease serology;
* Hepatitis B or hepatitis C testing indicating active/ongoing infection, as defined as:

  * HBV: Patients with positive HBsAg are excluded. Patients with positive anti-HBc and negative HBsAg require hepatitis B PCR evaluation before randomization. Patients who are hepatitis B PCR-positive will be excluded.
  * HCV: Patients with positive hepatitis C antibody may be enrolled with a negative result for hepatitis C RNA before study inclusion. Patients who are hepatitis C RNA-positive will be excluded.
* History of a symptomatic CNS disease (or which required treatment within the past year), such as stroke, epilepsy, CNS vasculitis, or neurodegenerative disease;
* Significant cardiovascular disease defined as ≥ grade 3 New York Heart Association functional classification system of heart failure, history of myocardial infarction, uncontrolled or symptomatic arrhythmias, or unstable angina within the past 6 months before the screening;
* Chronic lung disease, with hypoxemia (Oxygen saturation measured by pulse oximetry \> 93% on room air), or uncontrolled within 4 weeks before the screening visit
* History of an autoimmune disease (including, but not limited to, myasthenia gravis, myositis, autoimmune hepatitis, systemic lupus erythematosus, rheumatoid arthritis, inflammatory bowel disease, vascular thrombosis associated with antiphospholipid syndrome, Wegener's granulomatosis, Sjögren's syndrome, Guillain-Barré syndrome, multiple sclerosis, vasculitis, or glomerulonephritis) with end-organ damage or requiring systemic immunosuppression/systemic disease-modifying agents in the 2 years preceding the screening visit;

  * Participants with hypothyroidism receiving a stable dose of thyroid replacement hormone may be eligible.
  * Participants with controlled type 1 diabetes mellitus who are on an insulin regimen are eligible for the study.
* History of deep vein thrombosis or pulmonary embolism within 6 months before the screening visit, or need to use systemic anticoagulation at the time of screening for any other reason;
* Major surgery within 4 weeks of the screening visit;
* History or suspicion of hemophagocytic lymphohistiocytosis (HLH);
* Vaccination with a live or attenuated virus vaccine within one month before the screening visit;
* Patients with known hypersensitivity, including anaphylaxis, to any component of the investigational treatment;
* Pregnancy, lactation, or plan to get pregnant during the study or within 12 months after CAR-T cell infusion;
* In women of childbearing potential a negative serologic pregnancy test must be obtained 7 days before CAR-T cell infusion;
* Women of childbearing potential, and all male participants, must be willing to observe barrier and highly effective birth control methods (outlined in the study protocol) for 12 months following CAR-T cell infusion;
* Presence of any other medical condition that in the investigator's opinion may interfere with the safety or effectiveness evaluation of the study;
* Life expectancy less than 12 weeks, by investigator assessment.

Inclusion Criteria:

* Patients over 18 years;
* Patients with lung metastases arising from sarcoma;
* Patients who are not eligible for surgery for medical reasons, including limited cardiopulmonary reserve. In this cases we will perform a pulmonary function test (PFT) to determine if the patient can withstand ablation;
* Patients with recurrent metastases after pneumectomy or metastases after surgical resection. In this cases we will perform a PFT to determine if the patient can withstand ablation;
* Patients with pulmonary lesions with dimensions up to 3,0 cm in the largest axial diameter;
* Patients with four or fewer lesions. In cases of bilateral metastases, we will evaluate the treatment of only one lung at a time, with an interval of at least two weeks for the treatment of the contralateral lung, respecting the clinical evolution of the patient.
* Patients with no extrapulmonary metastases or just indolent extrapulmonary disease;
* Patients with prior histopathological confirmation of pulmonary lesions.

Exclusion Criteria:

* Patients with primary disease without clinical control;
* Presence of uncontrolled extrapulmonary disease, including lymph node progression;
* Presence of hilar lesions or near the main bronchi;
* Presence of five or more lung lesions and/or lesions larger than 3,0 cm in greatest axial length;
* Presence of tumors infiltrating the chest wall, mediastinal and/or pleural dissemination;
* Patients with severe coagulopathy (international normalized ratio (INR) \> 1,5 or lower platelet count to 50000/mm³);
* Patients with chronic obstructive pulmonary disease (COPD) stage III/ IV;
* Patients with septicemia;
* Patients refusing ablation treatment or participation in the study.

Inclusion Criteria:

* Patients between 16 and 60 years-old with refractory or relapsed ALL (≥1% of anomalous blasts by flow cytometry in bone marrow or peripheral blood) after one or two lines of therapy, regardless of their phenotype or baseline genetic alteration;
* Patients are eligible after allogeneic HSCT as long as patients are not actively being treated for graft-versus-host-disease (GvHD).

Exclusion Criteria:

* Burkitt leukemia;
* Prior myeloproliferative disease;
* Drug allergies;
* ECOG \>2;
* Total bilirubin\>2x upper limit of normal (ULN);
* Transaminases\>5x ULN;
* Creatinine\>2,5 mg/dl;
* Active uncontrolled infection;
* History of asparaginase-induced pancreatitis;
* Prior exposure to bortezomib;
* Heart failure New York Heart Association (NYHA) Class III or IV;
* Patients with more than 400mg/m2 lifetime exposure of anthracycline;
* Severe psychiatric disorder which prevents adequate compliance;
* Refusal to participate in the study.

Inclusion Criteria:

1. Participant must be ≥18 years of age;
2. Participant must have histologically or cytologically confirmed locally advanced or metastatic NSCLC not amenable to curative therapy. Participants must be treatment-naïve for metastatic NSCLC. Prior adjuvant and neo-adjuvant therapy for early-stage disease is permitted, prior systemic therapy for potentially curable locally advanced disease is also permitted;
3. Participant must have a tumor that was previously determined to have Exon 19del or Exon 21 L858R substitution, as detected by a validated test in accordance with site standard of care. Note: A copy of the test report documenting the EGFR mutation must be included in the participant records and must also be submitted to the sponsor prior to enrollment;
4. Unstained tumor tissue and blood (for ctDNA, biomarker), both collected prior to treatment initiation, must be provided. Unstained FFPE tumor tissue blocks must be provided whenever possible. Alternatively, re-cut unstained sections from FFPE tumor tissue block, presented on slides must be provided (recommended 10-15 slides);
5. Subject must have specific organ and bone marrow function;
6. Participant must have ECOG of 0 to 2;
7. Any toxicities from prior anticancer therapy must have resolved to CTCAE Grade 1 or baseline level;
8. Participant must have at least 1 measurable lesion, according to RECIST v1.1 that has not been previously irradiated. Target lesions situated in a previously irradiated area are considered measurable if progression has been demonstrated in such lesions.

Exclusion Criteria:

1. Participant has received any prior systemic treatment for metastatic disease (prior systemic therapy for potentially curable locally advanced disease, adjuvant or neoadjuvant therapy are allowed, if administered more than 12 months prior to the development of the recurrent disease);
2. Participant has symptomatic brain metastases. A participant with asymptomatic or previously treated and stable brain metastases may participate in this study. Participants who have received definitive radiation or surgical treatment for symptomatic or unstable brain metastases and have been clinically stable and asymptomatic for at least 2 weeks before Screening are eligible, provided they have been either off corticosteroid treatment or are receiving low-dose corticosteroid treatment (≤10 mg/day prednisone or equivalent) for at least 2 weeks prior to enrollment;
3. Participant has severe co-morbidities that in the opinion of the investigator pose the patient at undue risk from participating in the study;
4. Participant has an active or past medical history of leptomeningeal disease;
5. Participant has spinal cord compression that has not been definitively treated with surgery or radiation or requires steroid treatment within 2 weeks prior to enrollment. Low-dose corticosteroid treatment ≤10mg/day prednisone or equivalent is allowed;
6. Participant has an active or past medical history of Interstitial lung disease (ILD)/pneumonitis, including drug-induced or radiation ILD/pneumonitis;
7. Immune-mediated rash from checkpoint inhibitors that has not resolved prior to enrollment;
8. Subject has uncontrolled inter-current illness;
9. Participant has active cardiovascular disease;
10. Participant is currently receiving medications or herbal supplements known to be potent CYP3A4/5 inhibitors or inducers and is unable to stop use for an appropriate washout period prior to enrollment (see Appendix 8: Prohibited and Restricted Medications and Therapies That Induce, Inhibit, or Are Substrates of CYP3A4/5);
11. Participant has received any prior treatment with an EGFR TKI;
12. Known positive hepatitis B (hepatitis B virus \[HBV\]) surface antigen (HBsAg);
13. Known positive hepatitis C antibody (anti-HCV). Note: Subjects with a prior history of HCV, who have completed antiviral treatment and have subsequently documented HCV RNA below the lower limit of quantification per local testing are eligible;
14. Other clinically active or chronic liver disease;
15. Known active infection including tuberculosis (clinical evaluation that includes clinical history, physical examination and radiographic findings, and TB testing in line with local practice), Patients positive for human immunodeficiency virus (HIV) can be eligible if receiving highly active antiretroviral therapy (ART) and CD4 count \&gt;350 within 6 months of the start of treatment (consultation of Medical Monitor is required in this case). Screening for tuberculosis, hepatitis B, hepatitis C, and/or HIV infections is not required, unless there is clinical suspicion of these infections;
16. Participant had major surgery (e.g., requiring general anesthesia), excluding placement of vascular access or tumor biopsy, or had significant traumatic injury within 2 weeks before signing the ICF, or will not have fully recovered from surgery, or has surgery planned during the time the participant is expected to participate in the study.

Inclusion Criteria:

* Gastric adenocarcinoma
* Presence of peritoneal carcinomatosis documented through intraoperative identification and confirmed by biopsies and/or positive oncotic cytology;
* Presence of exclusively peritoneal metastasis with PCI \< 12;
* Age between 18 and 75 years;
* ECOG 0 and 1;
* Body mass index (BMI) > 18;
* Total WBC count ≥3000, neutrophils ≥1500, hemoglobin ≥8, and platelet count ≥100,000;
* Bilirubin \<2, TGO/TGP/FA/GGT 3x the reference value;
* Creatinine clearance calculated by the Cockcroft-Gault formula ≥ 50 ml/min.

Exclusion Criteria:

* Synchronous or metachronic neoplasms;
* Previous antineoplastic treatment for gastric cancer;
* Clinical conditions considered critical by the investigator;
* Obstruction of the digestive tract;
* Suspected gastrointestinal bleeding;
* New York Heart Association functional class II/III/IV heart failure;
* Heart disease that, in the opinion of the investigator, prevents the patient from receiving the necessary hydration during chemotherapy with cisplatin.
* Known HIV infection or chronic use of immunosuppressants;
* Acute myocardial infarction or stroke in the last 6 months
* pregnant.

Inclusion Criteria:

* Breast cancer diagnostic at I and II stages;
* Adjuvant or neoadjuvant chemotherapy (≤50% of sessions completed);
* More than 18 years.

Exclusion Criteria:

* Current smoking
* Diabetic neuropathy;
* Hypertension uncontrolled;
* Heart failure;
* Clinical depression;
* Skeletal muscle impairment which not allow physical exercise.

Inclusion Criteria:

* Patients with a diagnosis of cancer in the oral cavity and oropharynx any clinical stage based on TNM staging of head and neck cancer;
* Patients who received oral care prior to oncological treatment;
* Patients who will receive conformational radiotherapy (RT-C3D) or Intensity-modulated radiotherapy (IMRT) from 50 Gy to 70 Gy (primary radiation field) in daily doses of 1.8-2, 12 Gy divided five times per week (from Monday to Friday), totalizing 6 to 7 weeks of treatment. They may receive exclusive RT or with chemotherapy concomitant with cisplatin (100 mg/m2 every 21 days or 50 mg/m2 per week);
* Patients feeding orally or by parenteral nutrition;
* Patients who agree to participate in the study after reading, filling, and signing the Consent Form for Participation in Clinical Research.

Exclusion Criteria:

* Patients who develop head and neck radiodermatitis and for this reason interrupt the survey;
* Patients who do not appear in four or more PBMT or RT sessions.

Inclusion Criteria:

1. Females, over 18 years, with histologically confirmed primary epithelial cancer of the endometrium of any cell type or uterine carcinosarcoma (mixed malignant mullerian tumour);
2. Clinically stage I disease (disease confined to body of uterus);
3. ECOG of 0 or 1;
4. Signed written informed consent;
5. Participant must meet criteria for a laparoscopic or robotic surgical approach as determined by the treating physician (e.g. suitable for TH BSO, ability to tolerate Trendelenberg positioning)
6. All available clinical evidence (physical examination findings, or medical imaging such as CT, MRI or ultrasound) demonstrates no evidence of extrauterine disease
7. Myometrial Invasion on MRI of not more than 50%. (Only if participant is \<45yo, has ONLY Grade 1 EAC and wishes to retain their ovaries).
8. Negative serum pregnancy test ≤ 30 days of surgery in pre-menopausal women and women \< 2 years after the onset of menopause.

Exclusion Criteria:

1. Evidence of extrauterine disease (apparent involvement of cervix, vagina, parametria, adnexa, lymph nodes, bladder, bowel or distant sites) by clinical examination and/or through medical imaging.
2. Enlarged retroperitoneal pelvic and/or aortic lymph nodes (\>1 cm) on medical imaging;
3. Estimated life expectancy of less than 6 months;
4. Patients who have absolute contraindications for adjuvant radiotherapy and/or chemotherapy;
5. Patients who have previously received radiation treatment to the pelvis
6. Serious concomitant systemic disorders incompatible with the study (at the discretion of the investigator);
7. Patient compliance and geographic proximity that do not allow adequate follow-up;
8. Patients with allergy to Indocyanine Green (ICG)
9. Patients who have had previous retroperitoneal surgery
10. Patients who require a retroperitoneal (pelvic +/- para-aortic) lymph node dissection (lymphadenectomy)
11. Other prior malignancies \<5 years before inclusion, except for successfully treated keratinocyte skin cancers, or ductal carcinoma of the breast insitu
12. Uterine perforation during endometrial tissue sampling

Inclusion Criteria:

* Women 18 years or older;
* Diagnosed with breast cancer;
* Ongoing breast cancer treatment (chemotherapy, radiotherapy and/or hormone therapy);
* Have daily access to a smartphone.

Exclusion Criteria:

* Women having another type of cancer;
* Perform physical training for three months before the intervention;
* Has medical contraindication to perform any type of physical activity;
* Have filled in yes on the PAR-Q and medical contraindication;
* Without cognitive conditions to use a smartphone or answer questionnaires;
* Illiterate women.

Inclusion Criteria:

1. Men between the ages of 40 and 65 years;
2. Exclusive heterosexual men, regardless of race or social class.
3. RP due to prostate cancer without metastasis;
4. RP performed less than 60 days before the screening visit;
5. Erectile function prior to normal RP, defined as IIEF questionnaire with more than 22 points in domain A;
6. Stable sexual partner (more than 2 months prior to RP), and intention to maintain the relationship during the study.
7. Continuous use of 5mg Tadalafil from the 30th up to the 60th day after RP.

Exclusion Criteria:

1. Prostate cancer in TNM stage classified as T3 or T4.
2. Perineal and/or open RP;
3. Necessity of other therapy for prostate cancer than RP, including radiation therapy or hormone therapy;
4. Uncontrolled diabetes at screening visit (HbA1C \> 10%);
5. Prior spinal cord injury with lower limb paralysis;
6. Current male hormone use, or hypogonadism, defined by total testosterone below 8 nmol/L (2300 pg/mL) or total testosterone between 8 and 11 nmol/L (2300 and 3170 pg/mL) and free testosterone \< 220 pmol/L (\< 64 ng/dL);
7. Patients with current depression, characterized by use or need for use of antidepressants.
8. Presence of genital lesions (such as severe penile fibrosis or Peyronie's disease) or active sexually transmitted disease (STD) (such as herpes, gonorrhea, candidiasis, HPV, and others) that impair analysis of local adverse effects on the genitalia;
9. Use of topical medications in the genital region that may interfere in the IP evaluation, as well as in its absorption or drug interaction;
10. Possession of penile prosthesis;
11. History of symptomatic hypotension, or diseases that increase the risk of symptomatic hypotension, such as patient with heart diseases (including history of angina and/or heart failure) and nephropathies;
12. Current use of nitrates, such as propatilnitrate (Sustrate®), isosorbide (Monocordil®, Cincordil®, Isordil®), nitroglycerin (Nitradisc®, Nitroderm TTS®, Nitronal®, Tridil®) and isosorbitol dinitrate (Isocord®);ketoconazole; ritonavir; and rifampicin.
13. Findings on ECG and/or laboratory tests that, in the Investigator's criteria, are considered significant and offer risk to the research volunteer's participation or may hinder the study analyses;
14. BP outside the limits considered safe: SBP below 90 mmHg or above 170 mmHg; or DBP below 50 mmHg or above 100 mmHg, except situations such as "white coat syndrome";
15. Diseases that can cause priapism, such as sickle cell anemia, multiple myeloma, or leukemia;
16. Histroy of priapism, defined as painful erection from up to 6 hours.
17. Current relevant diarrhea, defined as duration over four weeks, association with abdominal pain or dysabsortive syndrome, or presence of mucus, pus, or blood in the stool;
18. Known hypersensitivity to tadalafil and/or BZ371A;
19. History of symptomatic Lactose intolorence such as: the necessity of enzymatic treatment, abdominal distension or diarrhea when ingesting products or supplements with lactose;
20. Low adhsesion to 5mg Tadalafil use, characterized by the use of \<80% of the pills between the 30th and 60th day post PR;.
21. Pregnant or lacting partner.
22. Partner in childbearing age which does not accept to get exposed to the treatment
23. Any disease, condition or physical finding that the Investigator considers significant and that increases the risk of the research subject's participation or may interfere with the results, including severe debilitating illness, presence of cancer other than prostate cancer, severe mental illness persistent medication abuse;

Inclusion Criteria:

* Women \>25 years of age;
* Women undergoing colposcopy due to abnormal cervical screening or follow-up for a history of dysplasia;
* Women of childbearing potential must have a negative urine or blood pregnancy test;
* Ability to understand and willingness to provide informed consent by signing specific Informed Consent Document.

Exclusion Criteria:

* Women under 25 years of age;
* Women who have undergone hysterectomy with removal of the cervix;
* Women with known allergy to proflavine or acriflavine;
* Women who are pregnant or nursing at the time of enrollment;
* Incapacitated women or in vulnerable situations or who are not willing to give consent;

Inclusion Criteria:

* Patients older than 18 years;
* Confirmed histological diagnosis of squamous cell carcinoma / squamous cell carcinoma of the anal canal (ACSCC);
* Patients with localized ACSCC (≥ T2N0M0, according to American Joint Committee on Cancer (AJCC) 8th edition) staged by conventional imaging methods according to institutional routine;
* Indication of starting definitive treatment with Ch-RT in the institution. HIV-positive patients may be included;
* Free and informed consent signed by the patient or legal representative

Exclusion Criteria:

* Diagnosis of perianal squamous cell carcinomas;
* Clinical condition leading to difficulty in swallowing;
* Patients with a contraindication to receiving Ch-RT, ie receiving only radiotherapy or not receiving polychemotherapy;
* Clinical condition that, due to the investigator's judgment, prevents adherence to the study
* Active infection requiring antibiotic therapy

Inclusion Criteria:

* Patients aged between 18 and 80 years old;
* Presence of bladder tumor \> 3cm without signals of MIBC or advanced disease (US, CT scan or MRI 3 months before surgery)
* Able to understand and willing to sign a written informed consent document
* Satisfactory clinical pre operatory conditions for surgery with regional or general anesthesia.

Exclusion Criteria:

* Previous diagnosis of muscle-invasive bladder cancer;
* Tumor's Invasive aspect (T2 or more) on image (US, TC or RNM);
* Previous TURBT in the last 5 years;
* Urethral stenosis;
* Previous intra-vesical os systemic chemotherapy or radiotherapy;
* Previous treatment with intravesical BCG
* No clinical conditions for regional or general anesthesia;
* Any other significant disease or disorder which, in the opinion of the investigator may either put the participant at risk because of trial participation or may influence the trial result, or the participant's ability ti participate in the trial.

Inclusion Criteria:

* Histopathological diagnosis of molar pegnancy according to the morphological criteria described by Sebire et al., who meet the diagnostic criteria for low-risk non-metastatic GTN according to FIGO 2000 criteria

Exclusion Criteria:

1. High risk GTN (FIGO risk score ≥ 7) or metastatic disease at diagnosis of GTN (stage II, III or IV);
2. Histopathological diagnosis of choriocarcinoma, placental site trophoblastic or epithelioid trophoblastic tumor at the second curettage;
3. Previous chemotherapy treatment;
4. Level of hCG at the time of GTN diagnosis less than 20 IU/L (to minimize the risk of inclusion of patients with false positive hCG, either by cross-reaction with pituitary hormones or by the presence of circulating heterophilic antibodies);
5. Relapsed GTN;
6. Incomplete medical records.
7. Loss to follow-up;
8. Voluntary desire to stop participating in the study.

Inclusion Criteria:

* Patients who sign the Informed Consent Form, indicating that they understand the study procedures and their purpose;
* Women aged between 18 and 80 years old;
* Gynecological surgery performed by laparotomy;
* Patients with ECOG of at least 2 (ECOG ≤2);
* Preoperative schedule that allows prehabilitation intervention for 2 to 3 weeks

Exclusion Criteria:

* Patients under 18 or older than 80 years old;
* ECOG ≥3;
* Significant comorbidities, such as: neurological or musculoskeletal disorder, heart disease and / or respiratory failure that prohibit physical exercise;
* Limitation of ambulation preventing the patient to perform physical exercises;
* Cognitive deterioration or patients with psychiatric disorder that prevents adherence to the program;
* Emergency or urgency surgeries;
* Surgeries by minimally invasive approach (laparoscopy or robotics);
* Vulvectomy or soft tissue surgery without abdominal approach;
* Minor gynaecological surgeries such as conizations;
* Surgeries performed together with other specialties, in which the gynecology team is not primarily responsible for postoperative care;
* If surgery is performed 21 days after the last day of the prehabilitation program, for any reason

Inclusion Criteria:

1. Age 18 years or older;
2. Hepatocellular carcinoma with histological or cytological confirmation or that meet radiological criteria for the diagnosis of HCC21;
3. BCLC-B stage not candidate for locoregional treatment or BCLC-C;
4. Have been previously treated with at least 1 line of systemic treatment with sorafenib, levantinib, atezolizumab plus bevacizumab or other immunotherapy-based regimen;
5. Have received the last dose of first-line systemic treatment between 2 and 6 weeks before starting study treatment;
6. Recovery to baseline or ≤ grade 1 from toxicities related to any previous treatments, unless the adverse event is not clinically significant as determined by the investigator (according to the Common Terminology Criteria for Adverse Events (CTCAE) v522);
7. Not having received previous treatment with regorafenib;
8. Child-Pugh A or B7 (in the absence of clinical ascites);
9. Measurable disease as defined by the RECIST 1.1 criteria. Target lesions must not have undergone previous local or locoregional treatment (example: ablation, transarterial chemoembolization, radiotherapy or selective internal radiotherapy)
10. Performance status: ECOG 0 or 1.
11. Adequate hematologic, hepatic and renal functions as defined below:

    i. Hemoglobin ≥ 8.5 g/dl ii. Absolute neutrophil count ≥ 1,000 /mm3 iii. Platelet count ≥ 50,000 /mm3 iv. Total bilirubin \< 2.0 x upper limit of normality (ULN) v. ALT or AST \<5 x LSN vi. Creatinine clearance (CrCI) ≥ 30 mL/min (according to Cockroft-Gault formula) vii. Serum albumin ≥ 2.8 mg/dl
12. Ability to understand informed consent and comply with the treatment protocol.
13. Informed consent form and clarification signed by the patient, impartial witness or legal representative.
14. Sexually active patients of childbearing potential and their partners must agree to use highly effective methods of contraception that result in a rate of less than 1% per year when used consistently and correctly throughout the study and 6 months after treatment discontinuation;
15. Female participants of childbearing potential cannot be pregnant at screening.

Exclusion Criteria:

1. Fibrolamellar carcinoma, sarcomatoid HCC or mixed hepatocellular cholangiocarcinoma;
2. Previous use of regorafenib;
3. Hepatic encephalopathy or medication requirement to control hepatic encephalopathy in the last 60 days before randomization;
4. Clinically significant ascites (ie, ascites that requires parcentesis or increased dose of diuretics) within 30 days prior to randomization.
5. Patients who have received local therapies (ablation, transarterial chemomebolization or surgery) within 28 days prior to randomization. Radiation treatments with the aim of pain control of bone metastases are allowed.
6. Known or suspected brain metastasis or cranial epidural disease unless adequately treated with surgery or radiotherapy and stable for at least 8 weeks from randomization.
7. Any participant who cannot be submitted neither to computed tomography (CT) nor magnetic resonance imaging (MRI) due to contra-indication to contrast media used.
8. The participant has an uncontrolled disease, or a significant complication in the last 28 days of randomization, such as:

   1. Cardiovascular disorders:

      * i. Class III or IV congestive heart failure as defined by the New York Heart Association, unstable angina pectoris, or symptomatic arrhythmias;
      * ii. Uncontrolled hypertension (defined as systolic blood pressure > 160 mmgHg or diastolic pressure \> 95 mmHg despite antihypertensive therapy);
      * iii. Stroke, myocardial ischemia, or any ischemic event within the 6-month period prior to randomization;
   2. Gastrointestinal disorders, including those associated with a high risk of perforation:

      * i: active peptic ulcer disease, inflammatory bowel disease, tumors invading the gastrointestinal tract, diverticulitis, cholecystitis, appendicitis, acute pancreatitis and cholangitis;
      * ii: Abdominal fistula, gastro-intestinal perforation or abdominal abscess in the last 6 months;
      * iii: Esophageal varices that have not been adequately treated or that have been incompletely treated with bleeding or high risk of bleeding. Participants treated with adequate endoscopic therapy with no bleeding in the past 6 months are eligible;
   3. Clinically detected hematuria, hematemesis, melena, hemoptysis (\>2.5 ml) or other clinically significant bleeding within the last 3 months of randomization.
   4. Cavitating pulmonary lesion or known manifestation of endobronchial disease;
   5. Other clinically significant diseases, at the discretion of the attending physician.
9. Majority surgery within 28 days of randomization. Minor surgeries within 10 days of randomization. Participants must have complete healing of the procedures prior to randomization;
10. History of psychiatric illness that is likely to interfere with the ability to understand the study procedures;
11. Pregnant or breastfeeding women;
12. Inability to swallow pills;
13. Known allergies to study drug components;
14. Any other known malignancy active at the time of randomization or diagnosis of another malignancy within two years of randomization, except superficial skin carcinomas or low-grade localized tumors considered cured and not treated with systemic therapy.

Inclusion Criteria:

* Malignant neoplastic wound in breast or head and neck;
* Malignant neoplastic wound with staging \>= II;
* KPS \>=30%
* Having at least 3 on the numerical pain rating scale (0-10);
* Admission time equal to or > 48 hours.
* Make use of systemic morphine.

Exclusion Criteria:

* Wound with fistula;
* Wound with extensive coagulation necrosis (\>50% of wound area;
* Exuding wound \> 1 (PUSH Scale);
* Bleeding wound \>1 (VIBe Scale)
* Ongoing radiotherapy on the wound.

Inclusion Criteria:

* 18 years of age or older
* Patients with fine needle aspiration biopsy (FNAb)-proven metastatic cervical lymph nodes at levels I, II, III, IV, V, VI or VII from differentiated thyroid carcinoma or medullary thyroid carcinoma who underwent total thyroidectomy and subsequent radioiodine therapy, in case of differentiated thyroid carcinoma.
* Patients considered high surgical risk candidate or patients who are informed about the ablation therapy and prefers it instead surgery;
* Patients with metastatic cervical lymph nodes over 0.8 cm diameter and under 4.0 cm diameter; no more than 6 simultaneous cervical nodal metastases;
* Cervical recurrences in previously lateral neck dissection patients for differentiated thyroid carcinoma or medullary thyroid carcinoma over 0.8 cm diameter.

Exclusion Criteria:

* Age under 18 years
* Uncorrectable coagulopathy;
* Inconclusive or benign cytologic specimens;
* Pregnancy or breast-feeding;
* Anaplastic or poor-differentiated thyroid carcinoma;
* Partial thyroidectomy
* Cervical tumors not considered to surgery (invading vessels, nerves, larynx or trachea);
* Serious medical illness, including any of the following: uncontrolled angina, myocardial infarction, cerebrovascular event within 6 months prior to the baseline visit, uncontrolled congestive heart failure;
* Participation in other studies that could affect the primary endpoint

Inclusion Criteria:

* Renal cell carcinoma patient: histological confirmed clear cell tumor;
* First-line metastatic treatment;
* Stage IV with at least one measured lesion;
* Fresh-frozen primary tumor tissue available;
* No previous immunotherapy or tyrosine kinase inhibitor treatment;
* All International Metastatic RCC Database Consortium (IMDC) Risk Score;
* KPS \>=70;
* \>=18 years old.

Exclusion Criteria:

* History of a known or suspected autoimmune disease;
* Any condition requiring systemic treatment with corticosteroids;
* Creatinine clearance \< 40mL/min;
* Alanine aminotransferase (ALT) and/or Aspartate Aminotransferase (AST) \> 5 x ULN;
* Pregnant women.

Inclusion Criteria:

* Women diagnosed with stage I-III breast cancer;
* Aged ≥ 18 years old;
* Have completed primary treatment for breast cancer (including surgery, chemotherapy, and/or radiotherapy) for at least six months and at most 12 months before the start of the intervention, regardless to be or not on hormonal treatment;
* Willingness to participate in either intervention group, as well as not to have a fear of the aquatic environment.

Exclusion Criteria:

* Presence of serious orthopedic, cardiovascular, or cardiopulmonary conditions that limit physical exercise participation;
* Major psychiatric or cognitive disorders;
* Active metastatic or locoregional disease;
* Severe nausea, anorexia, or another condition that makes it impossible to participate in the exercise;
* Engagement in regular exercise for more than 75 min weekly.
* Or were otherwise not cleared by their oncologist.

Inclusion Criteria:

* The patient is 18 years of age or older;
* The patient has been diagnosed with a primary extremity grade II or III soft-tissue sarcoma (STS);
* The patient has undergone surgical excision of the tumor with curative intent and with no evidence of gross residual disease based on the pathology report;
* The patient has completed all planned neoadjuvant or adjuvant radiation and / or chemotherapy, if applicable;
* The tumor size is > or equal to (≥) five centimeters according to the pathology report or based on the pre-treatment MRI if neoadjuvant radiation and / or chemotherapy are given; and
* The patient provides informed consent.

Exclusion Criteria:

* The patient has metastases at initial presentation based on the radiology report of the initial thoracic imaging†;
* The patient has recently undergone surgical excision of a local recurrence;
* The patient has been diagnosed with one of the special sub-types, myxoid / round cell liposarcoma or extra-skeletal Ewing's sarcoma\*;
* The patient has been previously diagnosed with a genetic syndrome with an elevated risk of malignancy, such as Li-Freumeni Syndrome‡;
* The patient has been previously diagnosed with a co-morbid condition that has a life expectancy of less than (\<) one year;
* The site-specific surveillance protocol for the patient's disease is not compatible with the study protocol (i.e., regular planned whole-body imaging with positron emission tomography \[PET\] scans);
* Likely problems, in the judgment of the investigator, with the patient maintaining follow-up (with the specific reasoning requiring approval of the Methods Center);
* The patient is currently enrolled in a study that does not permit co-enrolment; and
* The patient has already been enrolled in the SAFETY trial.

  * A second CT scan may be required to confirm that indeterminate nodules are false positives before the patient can be enrolled (provided that the second CT scan shows no evidence of metastatic disease);

    * Myxoid liposarcoma and extra-skeletal Ewing's sarcoma have different metastatic patterns, which necessitate different surveillance protocols;

      * Individuals with Li-Freumeni Syndrome, or other genetic syndromes with an elevated risk of malignancy, appear to be at an elevated risk for radiation-induced cancers, so the use of CT scans should be limited.

Inclusion Criteria:

* Women

  1. Age over 18 years
  2. Undergo surgical treatment for breast cancer
  3. Diagnosed with lymphedema in the upper limb stabilized for a period ≥6 months
  4. Indicated the second phase of compressive therapy / treatment of lymphedema

Exclusion Criteria:

* Women with:

  1. Bilateral lymphedema;
  2. Lymphedema since the preoperative period;
  3. Presence of phlogistic signs in the limb with lymphedema;
  4. Treatment of lymphedema (phase 1) in the last three months;
  5. Previous history of allergic reaction to the material used for compressive therapy;
  6. Active regional or remote disease;
  7. In chemotherapy or radiation therapy;
  8. Functional changes in the upper limbs prior to the diagnosis of breast cancer;
  9. Heart disease and decompensated systemic arterial hypertension; psychiatric, mental, neurological disorders or cognitive deficits that make it impossible to answer the questionnaires.

Inclusion Criteria:

1. Age ≥18 years;
2. ECOG 0-2 or KPS≥70;
3. Primary rectal adenocarcinoma (biopsy confirmed) within the reach of digital rectal examination (at least lower tip/border) by the attending colorectal surgeon;
4. Endoscopic documentation;
5. Abdominal and chest CT scans showing no evidence of metastatic disease;
6. High-resolution magnetic resonance images performed at either 1.5T or 3.0T system using a phased array surface coil with: sagittal T2 images including the anal verge and the sacrum; axial oblique T2 weighted images acquired in a plane perpendicular to the long axis of the rectal wall guided by the sagittal images; coronal images acquired in parallel to the anal canal plane. Small field of view (16-18cm), 3mm section thickness, increased matrix size and increased number of signal averages are required;
7. Radiological defining criteria (centralized):

   1. Lower edge of tumor at the level (max. 1cm distance) or below the anorectal ring defined at sagittal or coronal views;
   2. mrT2, mrT3 (any subclassification)
   3. mrN0-1 (≤3 radiologically positive lymph nodes)
   4. mrEMVI: any status
   5. mrMRF: any status

Exclusion Criteria:

1. Pregnancy
2. ECOG ≥3 or KPS\<70
3. Unwilling to consent
4. Metastatic disease (any kind; internal iliac and obturator nodes are considered local disease and not metastatic disease and therefore will not be considered as exclusion criteria)
5. mrT4 or mrN2
6. Previous pelvic irradiation
7. Baseline neuropathy
8. Receiving treatment of other anti-cancer drug or methods
9. Presence of uncontrolled life threatening diseases
